define('events/player/directives/pluggable_components/comments',[

    // Base Module
    'shared/base_modules/directive',

    //templates
    'text!events/player/templates/pluggbale_components/comments.html',

    // utility
    'shared/util'

], function (

    DirectiveModule,

    // templates
    CommentsTemplate,

    Util

) {

    DirectiveModule.directive('commentsComponent', ['$timeout', '$interpolate', 'videoPlayer',
        'eventData', 'sharedVar', 'feedData', 'currentUser', 'socketio',
        function ($timeout, $interpolate, VideoPlayer, Event, sharedVar, FeedData, currentUser, SocketIO) {

            return {
                restrict : 'EA',
                scope : {
                    playerName : '=',
                    componentType : '=',
                    isEmbed : '=',
                    componentIndex : '='
                },
                link : function (scope) {
                    var player, component, drawerOpened = false;
                    scope.notifyClass = '';
                    //scope.commentsCount = '';

                    var commentsComponent = function () {
                        var toolTipText;
                        component = new Player.Core.ExternalComponent('comments');

                        component.addListener('click', function () {
                            // drawerOpened to prevent drawer toggle when clicked multiple times
                            if (!drawerOpened) {
                                drawerOpened = true;
                                if (scope.componentType === 'event') {
                                    scope.notifyClass = '';
                                    component.update();
                                    sharedVar.toggleDrawer('chat', 'baseEvent.content');
                                } else {
                                     $timeout(function(){
                                         sharedVar.showPostComment();
                                     }, 200);
                                }
                                $timeout(function () {
                                    drawerOpened = false;
                                }, 2000);
                            }
                        });
                        component.setRenderRoutine(function () {
                           return ($interpolate(CommentsTemplate)(scope));
                        });
                        toolTipText = scope.componentType === 'event' ? 'Open Chat' : 'Comment';
                        component.setTextRoutine(function () {
                           return toolTipText;
                        });
                        return component;
                    };

                    var init = function () {
                        if ((scope.componentType === 'event' && Util.getQueryParameter('enableInfoAndActivity') === 'false') ||
                            (scope.componentType !== 'event' && Util.getQueryParameter('enableInfo') === 'false') ||
                            (scope.componentType !== 'event' && scope.isEmbed && Event.isWhiteLabeled())) {
                                return;
                        }

                        player = VideoPlayer.getPlayer(scope.playerName);
                        if (player && player.videoStream) {
                            if (scope.componentType === 'event') {
                                scope.eventData = Event;
                                //scope.commentsCount = '';
                                scope.$watch('eventData.live_chat_enabled', function () {
                                    if (Event.live_chat_enabled) {
                                        player.videoStream.executeAtCore('addExternalComponent', [commentsComponent(), scope.componentIndex]);
                                    } else {
                                        player.videoStream.executeAtCore('removeExternalComponent', [component]);
                                        component = undefined;
                                    }
                                });

                                Event.getEventPromise().then(function () {
                                    SocketIO.initializeSocketIO({
                                        namespace : Event.eventSocketConfig().namespace,
                                        roomID : Event.eventSocketConfig().roomId,
                                        accountID : Event.owner.id
                                    }).then(function (connection) {
                                        connection.on('newComment', updateChatNotification);

                                        scope.$on('$destroy', function () {
                                            connection.removeListener('newComment', updateChatNotification);
                                        });
                                    });
                                });
                            } else {
                                scope.feedData = FeedData;
                                //scope.commentsCount = scope.feedData.selectedFeed.data.comments.total;
                                // scope.$watch('feedData.selectedFeed.data.comments.total', function () {
                                //     if (!component) {
                                //         return;
                                //     }
                                //     scope.commentsCount = scope.feedData.selectedFeed.data.comments.total;
                                //     component.update();
                                // });
                                scope.$watch('feedData.commentSettings.commentingEnabled', function () {
                                    if (FeedData.commentSettings.commentingEnabled) {
                                        player.videoStream.executeAtCore('addExternalComponent', [commentsComponent(), scope.componentIndex, true]);
                                    } else {
                                        player.videoStream.executeAtCore('removeExternalComponent', [component]);
                                        component = undefined;
                                    }
                                });
                            }
                            if ((scope.componentType === 'event' && !Event.live_chat_enabled) ||
                                (scope.componentType !== 'event' && !FeedData.commentSettings.commentingEnabled)) {
                                    player.videoStream.executeAtCore('addExternalComponent', [commentsComponent(), scope.componentIndex, true]);
                            }
                        }
                    };

                    var updateChatNotification = function (event) {
                        if (event.data.postId === 'video:'+ Event.streamStatus.streamId) {
                            var newChat = event.data.data;
                            if (component && newChat.author_id !== currentUser.id && sharedVar.activeDrawer !== 'chat') { // do not show chat head for current user
                                scope.notifyClass = 'notify'; // notify for new chat messages
                                component.update();
                            }
                        }
                    };

                    init();
                }
            };
    }]);
});


