define('events/player/directives/pluggable_components/settings',[

    // Base Module
    'shared/base_modules/directive',

    //templates
    'text!events/player/templates/pluggbale_components/settings_dropdown.html',
    'text!events/player/templates/pluggbale_components/settings.html'

], function (

    DirectiveModule,

    // templates
    SettingsDropdownTemplate,
    SettingsTemplate

) {

    DirectiveModule.directive('settingsComponent', ['$interpolate', '$document', 'videoPlayer', 'feedData', 'eventData',
        function ($interpolate, $document, VideoPlayer, FeedData, EventData) {

            return {
                restrict : 'EA',
                template : SettingsDropdownTemplate,
                scope : {
                    playerName : '=',
                    componentIndex : '='
                },
                link : function (scope, element) {
                    var player, querySelector, dropdDownOpen = false;

                    var settingsComponent = function () {
                        var component = new Player.Core.ExternalComponent('settings');
                        querySelector = element[0].querySelector('.js-post_settings_modal_dropdown');
                        component.addListener('click', function () {
                            if (dropdDownOpen) {
                                querySelector.classList.remove('open');
                                querySelector.classList.add('close');
                                player.videoStream.executeAtCore('setExternalUiState', [false]);
                                removeOutsideClickCallback();
                            } else {
                                querySelector.classList.remove('close');
                                querySelector.classList.add('open');
                                player.videoStream.executeAtCore('setExternalUiState', [true]);
                                setOutsideClickCallback();
                            }
                            dropdDownOpen = !dropdDownOpen;
                        });
                        component.setRenderRoutine(function () {
                           return (SettingsTemplate);
                        });
                        return component;
                    };

                    var init = function () {
                        player = VideoPlayer.getPlayer(scope.playerName);
                        scope.selectedFeedData = FeedData.selectedFeed;
                        scope.hasProducerAccess = EventData.hasProducerAccess();
                        if (player && player.videoStream) {
                            player.videoStream.executeAtCore('addExternalComponent', [settingsComponent(), scope.componentIndex, true]);
                        }
                    };

                    init();

                    var callback = function () {
                        querySelector.classList.remove('open');
                        querySelector.classList.add('close');
                        player.videoStream.executeAtCore('setExternalUiState', [false]);
                        dropdDownOpen = false;
                        removeOutsideClickCallback();
                    };

                    var setOutsideClickCallback = function () {
                        setTimeout(function () {
                            $document.on('click', callback);
                        }, 100);
                    };

                    var removeOutsideClickCallback = function () {
                        $document.off('click', callback);
                    };
                }
            };
    }]);
});


