define('lib/vimeo_ref_vuid',[], function () {

	function appendQueryString (url, name, value) {
        return url + (url.indexOf('?') >= 0 ? '&' : '?') + name + '=' + encodeURIComponent(value);
    }

    function init() {
        var vuid = window.cookieFunctions.getCookie('vuid');

        // Get a list of all anchor tags
        var tags = document.querySelectorAll('a')
        var href;
        // Check if the href is to vimeo.com
        for (var i = 0; i < tags.length; i++) {
            href = tags[i].getAttribute('href');
            if (href && (href.match(/^(https?:)?\/\/vimeo\.com\//) || href.match(/^(https?:)?\/\/(\w.*)\.ci\.vimeows\.com\//))) {
                // Check if it has query string referrer_vuid defined
                if (!href.match(/[\?&]referrer_vuid=/)) {
                    // If not append query string
                    tags[i].setAttribute('href', appendQueryString(href, 'referrer_vuid', vuid));
                }
            }
        }
    }

    return {
        init: init
    }
});

