define('text!events/templates/lead_capture_fields/email_field.html',[],function () { return '<div class="lead_capture_input_wrapper"\nng-class="{\'has_error\' : ((formCollection.blockForm.email.$dirty || forceValidation) && formCollection.blockForm.email.$error.required) || (forceValidation && formCollection.blockForm.email.$error.pattern)}">\n    <input type="email" ng-pattern="emailRegEx" class="lead_capture_input" name="email" placeholder="Email" ng-required="true" ng-model="formObj.email" maxlength="80"/>\n    <div class="lead_capture_error_message" ng-show="((formCollection.blockForm.email.$dirty || forceValidation) && formCollection.blockForm.email.$error.required)">Please enter your email</div>\n    <div class="lead_capture_error_message" ng-show="(forceValidation && (formCollection.blockForm.email.$error.pattern || formCollection.blockForm.email.$error.email))">Please enter a valid email</div>\n</div>\n';});


