define('events/embeds/directives/info',[

    // library
    'shared/base_modules/directive',
    'text!events/embeds/templates/info.html'

], function (

    // library
    DirectiveModule,
    // template
    EventInfo,

) {

    DirectiveModule.directive('eventInfo', ['$sce', '$timeout', 'eventData',
        'sharedVar', 'location', 'loginWindow',
        function ($sce, $timeout, Event, sharedVar, Location, loginWindow) {
            return {
                restrict: 'A',
                scope: {},
                template: EventInfo,
                //replace: true,
                controller: ['$scope', 'currentUser', 'account', 'classification', function ($scope, currentUser, Account, Classification) {

                    var init = function () {
                        Classification.getCategory({
                            eventUrl : Event.url(),
                            eventId : Event.id
                        }).then(function (data) {
                            if (data) {
                                $scope.categoryName = data.name;
                            }
                        });
                    };

                    // follow/unfollow functionality
                    $scope.followAccount = function () {
                        if (currentUser.isLoggedIn()) {
                            Account.followUnfollow({
                                'location' : 'event header'
                            });
                        } else {
                            loginWindow.open({
                                action : 'follow',
                                event_id    : Event.id,
                                account_id  : Event.owner.id
                            }, function() {
                                Event.owner.is_following = true;
                            });
                        }
                    };

                    init();
                }],
                link: function (scope, element, attrs) {
                    scope.sharedVar = sharedVar;
                    scope.eventData = Event;
                    scope.has_location = false;
                    scope.noImageError = true;
                    var initMap = function (location) {
                        if (window.mapboxgl) {
                            mapboxgl.accessToken = window.config.mapboxToken;
                            var map = new mapboxgl.Map({
                                container: 'map',
                                style: 'mapbox://styles/mapbox/streets-v11',
                                center: [location.lng, location.lat],
                                zoom: 13,
                            });

                            map.scrollZoom.disable();
                            map.addControl(new mapboxgl.NavigationControl());

                            new mapboxgl.Marker()
                                .setLngLat([location.lng, location.lat])
                                .addTo(map);
                        }
                    };

                    var init = function () {
                        Location.getLocation().then(function (location) {
                            if (location.lat) {
                                scope.has_location = true;
                                initMap(location);
                                angular.element(document.querySelector('.js-event_info_wrapper')).removeClass('no_map');
                            }
                        });
                    };

                    scope.isWhiteLabeled = function () {
                        return Event.isWhiteLabeled();
                    };

                    scope.imageError = function () {
                        scope.noImageError = false;
                    };

                    init();
                }
            };
    }]);
});


