        var contentToShare;
        var share_facilitator = {

            shareUrl : '',

            urlToShare : function (content) {
                if (typeof content !== 'undefined') {
                    contentToShare = content;
                    this.shareUrl = content.fullUrl();
                }

                return this.shareUrl;
            },

            urlWithTimeStamp : function () {
                return this.shareUrl +
                    (this.shareUrl.indexOf('?') > 0 ? '&' : '?') + 't=' + (new Date()).getTime();
            },

            facebookUrl : function () {
                var baseUrl = "https://www.facebook.com/sharer/sharer.php?u=";
                var url = baseUrl + encodeURIComponent(this.urlWithTimeStamp());
                return url;
            },

            twitterUrl : function () {
                var baseUrl = "https://twitter.com/intent/tweet?text=";
                var body;
                switch (contentToShare.type) {
                    case 'account': body = 'Live Events from ' + contentToShare.full_name;
                        break;
                    case 'event': body = contentToShare.full_name;
                        break;
                    case 'status': body = contentToShare.data.text;
                        break;
                    case 'image':
                    case 'video': body = contentToShare.data.caption;
                        break;
                    default: body = '';
                        break;
                }
                var uri_component = 'Watch ' + body + ' on @Livestream: ' + this.urlWithTimeStamp();
                var url = baseUrl + encodeURIComponent(uri_component);
                return url;
            },

            tumblrUrl : function (owner_id) {
                var baseUrl = 'http://www.tumblr.com/share';
                var url;
                switch (contentToShare.type) {
                    case 'event': url = baseUrl + '/link?url=' + encodeURIComponent(this.shareUrl) +
                        '&name=' + encodeURIComponent(contentToShare.full_name) +
                        '&description=' + encodeURIComponent(contentToShare.description || '');
                        break;
                    case 'status': url = baseUrl + '/text?title=' + encodeURIComponent(contentToShare.data.text) +
                        '&url=' + encodeURIComponent(this.shareUrl) +
                        '&caption=' + encodeURIComponent(contentToShare.data.body || '');
                        break;
                    case 'image': url = baseUrl + '/photo?source=' + encodeURIComponent(contentToShare.data.image.medium_url) +
                        '&caption=' + encodeURIComponent(contentToShare.data.caption) +
                        '&clickthru=' + encodeURIComponent(this.shareUrl);
                        break;
                    case 'video':
                        var embedUrl =  (window.location.origin || Util.urlOrigin()) +'/accounts/' + owner_id + '/events/' + contentToShare.data.event_id + '/videos/' + contentToShare.id;
                        var videoIframe = '<iframe src="' + embedUrl +
                        '/player?autoPlay=false&mute=false&width=500&height=281" width="500" height="281" frameborder="0" scrolling="no"></iframe>';
                        url = baseUrl + '/video?embed=' + encodeURIComponent(videoIframe) +
                        '&caption=' + encodeURIComponent(contentToShare.data.caption) + 
                        '&url=' + encodeURIComponent(this.shareUrl);
                        break;
                    case 'account': url = baseUrl + '/link?url=' + encodeURIComponent(this.shareUrl) +
                        '&name=' + encodeURIComponent(contentToShare.full_name) +
                        '&description=' + encodeURIComponent(contentToShare.description || '');
                        break;
                }
                return url;
            }
        };

        return share_facilitator;
