define('shared/directives/canvas_image_blur',[

    // library
    'shared/base_modules/directive',
    'shared/util',
    'vendor/realtime_blur'

], function (

    // library
    DirectiveModule,
    Util

) {

    DirectiveModule.directive('canvasImageBlur', ['$window', function ($window) {


        return {
            restrict: 'A',
            link: function (scope, element, attr) {
                var isFirefox = navigator.userAgent.toLowerCase().indexOf('firefox') > -1;
                if (isFirefox) {
                    element.addClass('is_firefox'); // modify css based on class
                }
                var isEdgeBrowser = /Edge/.test(navigator.userAgent);

                var imgSrc = element.find('img')[0];
                imgSrc.onload = function () {
                    var canvas = element.find('canvas')[0];
                    var browserInfo = Util.getBrowserNameAndVersion();
                    // If chrome or firefox > 44, css blur is supported
                    if (!isEdgeBrowser && (browserInfo &&  (browserInfo.name.toLowerCase() === 'chrome') || (browserInfo.name.toLowerCase() === 'firefox' && browserInfo.version >= 44))) {
                        element.addClass('blur_background_image');
                        element.css('background-image' , 'url(' + imgSrc.src + ')');
                        if (canvas) {
                            canvas.remove();
                        }
                        return;
                    }
                    element.addClass('blur_canvas_image');
                    if (!canvas) {
                        return;
                    }
                    canvas.width = imgSrc.naturalWidth;
                    canvas.height = imgSrc.naturalHeight;
                    var ctx = canvas.getContext("2d");
                    ctx.drawImage(imgSrc,0,0, canvas.width, canvas.height);
                    var rt = new RTBlur({
                        source  : canvas,     /// source image, canvas or video
                        factor  : 3,   /// quality factor (default 3, range is [1, 5])
                        blurType: 'both',   /// blur both or vertical or hortizontal direction(s)
                        HQ      : false     /// High-Quality mode
                    });
                    rt.blur(100, ctx);

                    element[0].style.position = 'absolute';
                    element[0].style.top = 0;
                    var parentElem = document.querySelector('.js-newly_created_event');
                    if (!parentElem) {
                        return;
                    }
                    var parentPadding;
                    var blurWrapper = document.querySelector('.js-event_image_blur');
                    parentPadding = (parentElem.offsetHeight/parentElem.offsetWidth) * 100;
                    blurWrapper.style.paddingTop = parentPadding + '%';

                    var setParentPadding = Util.debounce(function() {
                        parentPadding = (parentElem.offsetHeight/parentElem.offsetWidth) * 100;
                        blurWrapper.style.paddingTop = parentPadding + '%';
                    }, 1000);

                    window.addEventListener('resize', setParentPadding);
                };
            }
        };
    }]);
});

define('shared/directives/outside_click',[

    // library
    'shared/base_modules/directive'

], function (

    // library
    DirectiveModule

) {

    DirectiveModule.directive('clickOutside', ['$document', '$timeout', function ($document, $timeout) {
        return {
            restrict: 'A',
            link: function (scope, element, attrs) {
                var triggerCall = function (e) {
                    if (document.body.contains(e.target) && e.target.tagName.toLowerCase() !== 'body' && element !== e.target && !element[0].contains(e.target)) {

                        //if clicked element(target) contains a class js-ignore_click_outside, do nothing
                        var ignore_containers = Array.prototype.slice.call(document.getElementsByClassName('js-ignore_click_outside'));
                        if (attrs.ignoreContainers) {
                            ignore_containers = ignore_containers.concat(Array.prototype.slice.call(document.getElementsByClassName(attrs.ignoreContainers)));
                        }
                        for (var i = ignore_containers.length - 1; i >= 0; i--) {
                            if (ignore_containers[i].contains(e.target)) {
                                return;
                            }
                        }
                        scope.$apply(function () {
                            if (angular.isDefined(attrs.clickOutside)) {
                                scope.$eval(attrs.clickOutside, {$event: e});
                            }
                        });
                    }
                };

                scope.$on('$destroy', function () {
                    $document.off('mousedown', triggerCall);
                });

                $timeout(function () {
                    $document.on('mousedown', triggerCall);
                }, 500);
            }
        };
    }]);
});


