define('shared/directives/time_ago',[

    // library
    'shared/base_modules/directive',
    'lib/user_timezone'

], function (

    // library
    DirectiveModule,
    UserTimeZone

) {
    var userTimeZone = UserTimeZone.getInstance();

    DirectiveModule.directive('timeAgo', ['$interval', function ($interval) {
        return {
            restrict: 'A',
            scope: {
                createdAt : '=',
                format : '@'
            },
            link: function (scope, element, attrs) {
                var now     = userTimeZone.initializeTime(),
                    format  = scope.format || 'short',
                    publish_time = userTimeZone.initializeTime(scope.createdAt),
                    timeInWords;
                var mins,
                    hours,
                    days,
                    mons,
                    years,
                    text = '';
                var updateTime = function() {
                    if (publish_time > now) {
                        timeInWords = returnInTime(publish_time, format)
                    } else {
                        timeInWords = returnTimeAgo(publish_time, format);
                    }

                    element.text(timeInWords);
                }
                var updateTimeAgo = $interval(updateTime, 60000);

                scope.$watch("createdAt", function () {
                    publish_time = userTimeZone.initializeTime(scope.createdAt);
                    updateTime();
                });

                scope.$on("$destroy" , function () {
                    $interval.cancel(updateTimeAgo);
                });

                var returnInTime = function (created_at, format) {
                    if (created_at) {
                        years   = created_at.diff(now, 'year');
                        mons    = created_at.diff(now, 'month');
                        days    = created_at.diff(now, 'day');
                        hours   = created_at.diff(now, 'hours');
                        mins    = created_at.diff(now, 'minutes');

                        if (format === 'short') {
                            if (years > 1) {
                                text = years + ' y';
                            } else if (mons > 0) {
                                text = mons + ' m';
                            } else if (days > 0) {
                                text = days + ' d';
                            } else if (hours > 0) {
                                text = hours + ' h';
                            } else if (mins > 0) {
                                text = mins + ' m';
                            } else {
                                text = 'now';
                            }
                        } else {
                            if (years > 1) {
                                text = 'in ' + years + ' year' + (years === 1 ? ' ' : 's ');
                            } else if (mons > 0){
                                text = 'in ' + mons + ' month' + (mons === 1 ? ' ' : 's ');
                            } else if (days > 0) {
                                text = 'in ' + days + ' day' + (days === 1 ? ' ' : 's ');
                            } else if (hours > 0) {
                                text = 'in ' + hours + ' hour' + (hours === 1 ? ' ' : 's ');
                            } else {
                                text = 'in ' + mins + ' minute' + (mins === 1 ? ' ' : 's ');
                            }
                        }

                        return text;
                    }
                }

                var returnTimeAgo = function (created_at, format) {
                    if (created_at) {
                        years   = now.diff(created_at, 'year');
                        mons    = now.diff(created_at, 'month');
                        days    = now.diff(created_at, 'day');
                        hours   = now.diff(created_at, 'hours');
                        mins    = now.diff(created_at, 'minutes');

                        if (format == 'short') {
                            if (years > 1) {
                                text = years + ' y';
                            } else if (mons > 0) {
                                text = mons + ' m';
                            } else if (days > 0) {
                                text = days + ' d';
                            } else if (hours > 0) {
                                text = hours + ' h';
                            } else if (mins > 0) {
                                text = mins + ' m';
                            } else {
                                text = 'now';
                            }
                        } else {
                            if (years > 1) {
                                text = years + ' year' + (years === 1 ? ' ' : 's ') + 'ago';
                            } else if (mons > 0){
                                text = mons + ' month' + (mons === 1 ? ' ' : 's ') + 'ago';
                            } else if (days > 0) {
                                text = days + ' day' + (days === 1 ? ' ' : 's ') + 'ago';
                            } else if (hours > 0) {
                                text = hours + ' hour' + (hours === 1 ? ' ' : 's ') + 'ago';
                            } else {
                                text = mins + ' minute' + (mins === 1 ? ' ' : 's ') + 'ago';
                            }
                        }

                        return text;
                    }
                };

                if (publish_time > now) {
                    timeInWords = returnInTime(publish_time, format);
                } else {
                    timeInWords = returnTimeAgo(publish_time, format);
                }
                element.text(timeInWords);
            }
        };
    }]);
});


