define('shared/directives/toggle_dropdown',[

    // library
    'shared/base_modules/directive'

], function (

    // library
    DirectiveModule

) {

    /*
     * directive to toggle a popup when clicked on element
     */
    DirectiveModule.directive('toggleDropdown', ['$document', '$timeout', function ($document, $timeout) {
        return {
            restrict: 'A',
            scope : {
                showClass : '@', // this will be added to popup that needs to be shown
                hideClass: '@',  // class to be added while hiding the popup
                toggleElement: '@', // popup class name
                activeName: '@', // classname to be added to clicked element to show active state
                hideOnPopupClick: '@', // if passsed as true popup will hide when clicked inside popup
                closeClass: '@', // clicking on this will hide the modal
                dynamicElement: '@', // clicking on element with this class will not hide the popup required when nodes are created on fly
                disappearElement: '@', // this element opacity will go zero when modal will appear
                modalContent: '@', //modal content class required to disable hiding of modal when clicked inside of modal
                childModal: '@', // if passed parent modal will not get closed when clicked on child modal
                parentModal: '@', // when nested modals add this to child modal to make parent modal visible when childmodal hides
                clickException: '@', // child modal class name, if passed, the parent modal will not close on clicking inside child
                onOpen: '&', // callback method for when the modal is opened
                onClose: '&', // callback method for when the modal is closed
                invertPosition : '@',
                containerElement : '@',
                preventDefault : '@'
            },
            link: function (scope, element, attrs) {
                scope.showClass = scope.showClass || "open";
                scope.hideClass = scope.hideClass || "close";
                scope.activeName = scope.activeName || "";
                scope.hideOnPopupClick = scope.hideOnPopupClick || false;
                scope.keepHiding = false;
                scope.modalContent = scope.modalContent || scope.toggleElement;

                element.on('click', function (event) {
                    if (scope.preventDefault) {
                        event.preventDefault();
                    }
                    var dropdown = angular.element(document.querySelector('.' + scope.toggleElement));
                    element.hasClass(scope.activeName) ? element.removeClass(scope.activeName) : element.addClass(scope.activeName);
                    var fadeOutElement = scope.disappearElement || scope.parentModal;
                    if (dropdown.hasClass(scope.showClass)) {
                        dropdown.removeClass(scope.showClass);
                        dropdown.addClass(scope.hideClass);

                        if (fadeOutElement) {
                            $timeout(function () { // required for smooth animation
                                angular.element(document.querySelector('.'+ fadeOutElement)).removeClass('fade_out').addClass('fade_in');
                            }, 50,false);
                        }
                    }
                    else {
                        dropdown.removeClass(scope.hideClass);
                        dropdown.addClass(scope.showClass);
                        if (fadeOutElement) {
                            $timeout(function () { // required for smooth animation
                                angular.element(document.querySelector('.'+ fadeOutElement)).removeClass('fade_in').addClass('fade_out');
                            }, 50,false);
                        }
                        if (scope.parentModal) {
                            angular.element(document.querySelector('.'+ scope.parentModal)).removeClass('fade_in').addClass('fade_out');
                        }
                        scope.onOpen({ $event: event });
                    }
                    if (dropdown.hasClass(scope.showClass)) {
                        handleClickOustide(element, attrs, dropdown, scope, $document, $timeout);
                    }

                    if (scope.invertPosition) {
                        var containerElementBottom = document.querySelector('.' + scope.containerElement).getBoundingClientRect().bottom;
                        var toggleElement = document.querySelector('.' + scope.toggleElement);
                        if (toggleElement.getBoundingClientRect().bottom  > containerElementBottom) {
                            toggleElement.classList.add('invert_position');
                        } else {
                            toggleElement.classList.remove('invert_position');
                        }
                    }
                });
            }
        };
    }]);

    var handleClickOustide = function (element, attrs, dropdown, scope, $document, $timeout) {
        var hidePopup = function (event) {
            var eventTarget     = event.target || event.srcElement;
            if (scope.clickException && document.querySelector('.' + scope.clickException)) {
                var clickExceptions = document.querySelectorAll('.' + scope.clickException);
                var isChildClicked = false;
                [].forEach.call(clickExceptions, function(element) {
                    if (element.contains(eventTarget)) {
                        isChildClicked = true;
                        return;
                    }
                });

                if (angular.element(eventTarget).hasClass(scope.clickException) || isChildClicked) {
                    return;
                }
            }

            if (scope.childModal && (angular.element(eventTarget).hasClass(scope.childModal) ||
                document.querySelector('.'+scope.childModal).contains(eventTarget))) {
                return;
            }
            if (scope.parentModal) {
                $timeout(function () { // required for smooth animation
                    angular.element(document.querySelector('.'+ scope.parentModal)).removeClass('fade_out').addClass('fade_in');
                }, 50, false);
            }
            element.removeClass(scope.activeName);
            dropdown.removeClass(scope.showClass);
            dropdown.addClass(scope.hideClass);
            scope.keepHiding = angular.element(eventTarget).hasClass('js-keep_hiding');
            if (scope.disappearElement && !dropdown.hasClass(scope.showClass) && !scope.keepHiding) {
                $timeout(function () { // required for smooth animation
                    angular.element(document.querySelector('.'+ scope.disappearElement)).removeClass('fade_out').addClass('fade_in');
                }, 50,false);
            }

            scope.onClose({ $event: event });
            $document.off('click', callback);
        };
        var callback = function (event) {
            var eventTarget = event.target || event.srcElement;
            if (scope.hideOnPopupClick) {
                hidePopup(event);
                return;
            }
            var modalContentEle = document.querySelector('.'+scope.modalContent);

            if (angular.element(eventTarget).hasClass(scope.closeClass)) {
                hidePopup(event);
            }
            if (scope.dynamicElement && angular.element(eventTarget).hasClass(scope.dynamicElement)) {
                return;
            }
            if (angular.element(eventTarget).hasClass(scope.modalContent) || (modalContentEle && modalContentEle.contains(eventTarget))) {
                return;
            }
            hidePopup(event);
        }

        // add delay for document on click as its running on element click itself
        setTimeout(function () {
            $document.on('click', callback);
        }, 100);
    };

});






