define('shared/directives/confirmation_box',[

    // library
    'shared/base_modules/directive',
    'text!shared/templates/confirmation_box.html',
    'shared/util'

], function (

    // library
    DirectiveModule,
    // template
    ConfirmationBox,
    //Util
    Util

) {

    DirectiveModule.directive('confirmationBox', ['$timeout', '$sce', 'modalFactory', function ($timeout, $sce, ModalFactory) {
        return {
            restrict: 'A',
            scope: {},
            template: ConfirmationBox,
            link: function (scope, element, attrs) {
                var init = function () {
                    ModalFactory.initModal(scope, 'confirmationBox');
                };

                // Feed dynamic content and control values on open callback. Following values are expected
                // cancelText, confirmText, desctiption, title, hideCancel, cancelCallback, confirmCallback
                // confirmCallbackParams, extraText
                scope.onShowConfirmationBox = function (options) {
                    ModalFactory.lockModalClose('ConfirmationBox');
                    options.cancelText = options.cancelText || 'Cancel';
                    options.extraInfo = $sce.trustAsHtml(options.extraInfo) || '';
                    options.hideCloseIcon = typeof options.hideCloseIcon !== 'undefined' ?
                        options.hideCloseIcon : options.hideCancel;
                    scope.confirmationOptions = options;
                    if (options.uniqueClass) {
                        scope.confirmationOptions.uniqueClass = options.uniqueClass;
                    }
                };

                scope.confirm = function () {
                    scope.modalControl.closeConfirmationBox();
                    $timeout(function () {
                        if (scope.confirmationOptions.confirmCallback) {
                            scope.confirmationOptions.confirmCallback(scope.confirmationOptions.confirmCallbackParams);
                        };
                        scope.confirmationOptions = {};
                    }, 300);
                };

                scope.closeConfirmationBox = function () {
                    scope.modalControl.closeConfirmationBox();
                    $timeout(function () {
                        if (scope.confirmationOptions.cancelCallback) {
                            scope.confirmationOptions.cancelCallback();
                        };
                        scope.confirmationOptions = {};
                    }, 300);
                };

                init();
            }
        };
    }]);
});


