define('text!events/templates/post_carousel.html',[],function () { return '<div class="post_carousel_wrapper" ng-if="sharedVar.cursorMovement && sharedVar.showLateralNavigation">\n\t<div ng-if="!isMobileDevice" class="posts_navigation left_nav" ng-click="getPreviousFeed()" ng-hide="noMoreOldFeed"\n\tng-class="{\'loading\' : sharedVar.previousPostLoading, \'disable\' : sharedVar.postNavClicked}">\n\t\t<preloader ng-if="sharedVar.previousPostLoading"></preloader>\n\t</div>\n\t<div ng-if="!isMobileDevice" class="posts_navigation right_nav" ng-click="getNextFeed()" ng-hide="noMoreNewFeed"\n\tng-class="{\'loading\' : sharedVar.nextPostLoading, \'disable\' : sharedVar.postNavClicked}">\n\t\t<preloader ng-if="sharedVar.nextPostLoading"></preloader>\n\t</div>\n</div>\n';});

define('events/directives/post_carousel',[

    'shared/base_modules/directive',
    'shared/util',

    // template
    'text!events/templates/post_carousel.html'

], function (

    DirectiveModule,
    Util,
    PostCarouselTemplate

) {

    DirectiveModule.directive('postCarousel', ['$timeout', '$state', 'feedData', 'sharedVar', 'formFactory', function ($timeout, $state, FeedData, sharedVar, FormFactory) {
        return {
            replace : true,
            restrict : 'EA',
            template : PostCarouselTemplate,
            link : function (scope, element) {
                var nextFeedIndex;
                scope.isMobileDevice = Util.isSmartPhoneOrTablet();
                var firstFeedId = FeedData.feedRef.feeds[0].data.id;
                var direction;
                var newPostAdded = false;
                sharedVar.showLateralNavigation = true;
                if ($state.params.enableLateralNavigation && ($state.params.enableLateralNavigation == "false" || window.innerWidth < 480)) {
                    sharedVar.showLateralNavigation = false;
                }
                var loadMoreFeeds = function () {
                    sharedVar.nextPostLoading = true;
                    FeedData.loadMoreFeed({
                        lastPostId : FeedData.selectedFeed.data.id,
                        lastPostType : FeedData.selectedFeed.type
                    }).then (function (response) {
                        sharedVar.nextPostLoading = false;
                        if (response.length < FeedData.feedRef.total && FeedData.feedRef.feeds.length < FeedData.feedRef.total) {
                            moveToNextFeed('right');
                        } else {
                            scope.noMoreNewFeed = true;
                        }
                    });
                };

                // recursively checks forwards if next posts are in transcoding state and skip all those posts
                var forwardRecursiveCheckIfTranscoding = function (index) {
                    if (FeedData.feedRef.feeds[index] && FeedData.feedRef.feeds[index].data.is_transcoding) {
                        if ((nextFeedIndex + 1) >= FeedData.feedRef.total) { // means this is index of last post having transcoding error
                            nextFeedIndex = nextFeedIndex - 1;
                            scope.noMoreNewFeed = true;
                        } else {
                            nextFeedIndex = nextFeedIndex + 1;
                            forwardRecursiveCheckIfTranscoding(nextFeedIndex);
                        }
                    } else {
                        if (!FeedData.feedRef.feeds[nextFeedIndex]) {
                            scope.noMoreNewFeed = true;
                        }
                    }
                };
                // recursively checks backwards if previous posts are in transcoding state and skip all those posts
                var backwardRecursiveCheckIfTranscoding = function (index) {
                    if (FeedData.feedRef.feeds[index] && FeedData.feedRef.feeds[index].data.is_transcoding) {
                        nextFeedIndex = nextFeedIndex - 1;
                        backwardRecursiveCheckIfTranscoding(nextFeedIndex);
                    } else {
                        if (!FeedData.feedRef.feeds[nextFeedIndex]) {
                            scope.noMoreOldFeed = true;
                        }
                    }
                };

                var closePostDetailEditDrawer = function () {
                    sharedVar.postDetailDrawerStatus.drawerVisible = false;
                    sharedVar.postDetailDrawerStatus.visibleDrawerName = null;
                    $timeout(function() {
                        sharedVar.postDetailDrawerStatus.hidePlayerIcon = false;
                    }, 300);
                    FormFactory.getForm().formScope.$dirty = false;
                    moveToNextFeed(scope.direction);
                };

                var moveToNextFeed = function (direction) {
                    scope.direction = direction;
                    if (nextFeedIndex < 0) {
                        nextFeedIndex = 0;
                        return;
                    }

                    if (FormFactory.getForm().formScope && FormFactory.getForm().formScope.$dirty) {
                        sharedVar.closeForm(closePostDetailEditDrawer);
                        return;
                    }
                    sharedVar.unbindFeedWatch(); // clear watch on feed data for the post sliding out to retain last post data
                    //if video is in transcoding state skip the video by increasing/decreasing nextFeedIndex based on direction
                    if (FeedData.feedRef.feeds[nextFeedIndex].data.is_transcoding === true) {
                        if (direction === 'right') {
                            forwardRecursiveCheckIfTranscoding(nextFeedIndex);
                        }
                        if (direction === 'left') {
                            backwardRecursiveCheckIfTranscoding(nextFeedIndex);
                        }
                    }
                    if (FeedData.feedRef.feeds[nextFeedIndex]) {
                        FeedData.selectedFeed = FeedData.feedRef.feeds[nextFeedIndex];
                    } else if (!FeedData.feedRef.feeds[nextFeedIndex] && direction === 'right') {
                        loadMoreFeeds();
                        return;
                    } else if (!FeedData.feedRef.feeds[nextFeedIndex] && direction === 'left') {
                        scope.noMoreNewFeed = true;
                        return;
                    }
                    sharedVar.postNavClicked = true;
                    $state.go('baseEvent.' + FeedData.selectedFeed.type + 'Post', {
                        post_id : FeedData.selectedFeed.data.id
                    }).then(function () {
                        $timeout (function () {
                            sharedVar.postNavClicked = false; // enable arrow click after slide is over
                        }, 500);
                        if (FormFactory.getForm().formScope) {
                            FormFactory.getForm().formScope.$dirty = false;
                        }
                        sharedVar.postDetailDrawerStatus.drawerVisible = false;
                        sharedVar.postDetailDrawerStatus.visibleDrawerName = null;
                        $timeout(function() {
                            sharedVar.postDetailDrawerStatus.hidePlayerIcon = false;
                        }, 300);
                    });
                };

                scope.getNextFeed = function () {
                    if (sharedVar.nextPostLoading || sharedVar.postNavClicked) {
                        return;
                    }
                    nextFeedIndex = FeedData.feedRef.selectedFeedIndex += 1;
                    if (FeedData.feedRef.feeds[nextFeedIndex]) {
                        moveToNextFeed('right');
                    } else {
                        loadMoreFeeds();
                    }
                };

                scope.getPreviousFeed = function () {
                    if (sharedVar.previousPostLoading || sharedVar.postNavClicked) {
                        return; // when api call is in progress return
                    }
                    if (typeof FeedData.feedRef.selectedFeedIndex === "undefined") {
                        nextFeedIndex = FeedData.feedRef.feeds.length - 1;
                    } else {
                        if (!nextFeedIndex) {
                            if (!newPostAdded) {
                                nextFeedIndex = FeedData.feedRef.selectedFeedIndex;
                            }
                        }
                    }
                    nextFeedIndex--;

                    if (FeedData.feedRef.feeds[nextFeedIndex]) {
                        moveToNextFeed('left');
                    } else {
                        nextFeedIndex = FeedData.feedRef.feeds.length - 1;
                        moveToNextFeed('left');
                    }
                };

                var disableNavButtons = function () {
                    if (FeedData.feedRef.total < 2) {
                        scope.noMoreOldFeed = true;
                        scope.noMoreNewFeed = true;
                        return;
                    }
                    scope.noMoreOldFeed = firstFeedId == $state.params.post_id ? true : false; // disable click on previous button
                    var totalFeeds = FeedData.feedRef.total;
                    if (FeedData.feedRef.feeds.length == totalFeeds && FeedData.feedRef.feeds[totalFeeds - 1].data.id == $state.params.post_id) {
                        scope.noMoreNewFeed = true;
                    }
                };
                disableNavButtons();

                scope.$on('$stateChangeSuccess', function onStateSuccess(event, toState, toParams, fromState) {
                    var totalFeeds = FeedData.feedRef.total;

                    if (FeedData.feedRef.feeds[totalFeeds - 1] && FeedData.feedRef.feeds[totalFeeds - 1].data.id == $state.params.post_id) {
                        // if current feed is last feed hide the next feed nav button
                        scope.noMoreNewFeed = true;
                    } else {
                        scope.noMoreNewFeed = false;
                    }
                    if (FeedData.feedRef.feeds.length && FeedData.feedRef.feeds[0].data.id == $state.params.post_id) {
                        scope.noMoreOldFeed = true; // hide prev nav button
                    } else {
                         scope.noMoreOldFeed = false;
                    }
                    if (FormFactory.getForm().formScope) {
                        FormFactory.getForm().formScope.$dirty = false;
                    }

                });

                sharedVar.swipeLeft = function () {
                    if (!scope.isMobileDevice || scope.noMoreNewFeed) {
                        return;
                    }
                    scope.getNextFeed();
                };

                sharedVar.swipeRight = function () {
                    if (!scope.isMobileDevice || scope.noMoreOldFeed) {
                        return;
                    }
                    scope.getPreviousFeed();
                };

                sharedVar.updatePostSlideIndexOnAdd  = function () {
                    if (!nextFeedIndex) {
                        nextFeedIndex = FeedData.feedRef.selectedFeedIndex;
                    }
                    nextFeedIndex++;
                    scope.noMoreOldFeed = false;
                    newPostAdded = true;
                };

                sharedVar.updatePostSlideIndexOnDestroy = function (deletedPostIndex) {
                    if (!nextFeedIndex) {
                        nextFeedIndex = FeedData.feedRef.selectedFeedIndex;
                    }
                    if (deletedPostIndex < nextFeedIndex) {
                        nextFeedIndex--;
                    }
                };
            }
        };
    }
    ]);

});

