define('shared/services/social_graph',[

    // base module
    'shared/base_modules/service'

], function (

    ServiceModule

) {

    ServiceModule.service('social_graph', ['connection', 'currentUser','$filter', function (Connection, currentUser, $filter) {

        this.getStatus = function (items) {
            items = items || [];
            if (!currentUser.isLoggedIn() || items.length === 0) {
                return;
            }
            var urlItems = [];
            angular.forEach(items, function (value) {
                if (value.type === 'account' && value.id !== currentUser.id) {
                    urlItems.push('follows:account:' + value.id)
                } else if (value.type !== 'account') {
                    urlItems.push('likes:' + value.type + ':' + value.id);
                }
            });

            // in case there is no items no use of making social graph call
            if (urlItems.length === 0) {
                return;
            }

            Connection.get({
                url : '/accounts/' + currentUser.id + '/social_graph/' + urlItems.join(','),
                api : true,
                authorize : true
            })
            .then(function (data) {
                var item;
                angular.forEach(items, function (value) {
                    if (value.type === 'account') {
                        if ((typeof data.follows === 'object') && data.follows.length > 0) {
                            item = $filter('filter')(data.follows, { id : value.id })[0];
                            value.is_following = typeof item === 'undefined' ?
                                false : item.following;
                        }
                    } else {
                        if ((typeof data.likes === 'object') && data.likes.length > 0) {
                            item = $filter('filter')(data.likes, { id : value.id })[0];
                            value.is_liked = typeof item === 'undefined' ?
                                false : item.has_like;
                        }
                    }
                });
            }, function () {
                // Do nothing, function has been added to catch exception
            });
        },

        this.resetStatus = function (items) {
            items = items || [];
            angular.forEach(items, function (value) {
                if (value.type === 'account') {
                    value.is_following = false;
                } else {
                    value.is_liked = false;
                }
            });
        }
    }]);
});

