define('shared/factories/modal_factory',[

    // library
    'shared/base_modules/factory'

], function (

    // library
    FactoryModule

) {

    FactoryModule.factory('modalFactory', ['$timeout', '$q', 'sharedVar', function ($timeout, $q, sharedVar) {

        var modalCloseLock = false;
        var visibleModals = [];

        return {
            lockModalClose: function (modal) {
                modalCloseLock = modal;
            },

            initModal: function(scope, name) {
                name = name.charAt(0).toUpperCase() + name.slice(1);
                scope['modal'+name] = {};

                var init = function () {
                    if (angular.isUndefined(scope.modalControl)) {
                        scope.modalControl = sharedVar;
                    }

                    scope['modal'+name].show = undefined;
                    scope['modal'+name].render = false;
                };

                init();

                scope.modalControl['show'+name] = function (openCallbackParam) {
                    scope.deferred = $q.defer();
                    if(scope['modal'+name].show) {
                        scope.modalControl['close'+name]();
                        return;
                    }
                    $timeout(function(){
                        scope['modal'+name].render = true;
                    }, 0);
                    $timeout(function () {
                        scope['modal'+name].show = true;
                        if (scope['onShow'+name]) {
                            scope['onShow'+name](openCallbackParam);
                        }
                    }, 200);
                    visibleModals.push(name);
                    return scope.deferred.promise;
                };

                scope.modalControl['close'+name] = function (closeCallbackParam) {
                    if (modalCloseLock && modalCloseLock !== name) {
                        return;
                    } else {
                        modalCloseLock = false;
                    }
                    scope['modal'+name].show = false;
                    if (scope['onClose'+name]) {
                        scope['onClose'+name](closeCallbackParam);
                    }
                    $timeout(function () {
                        init();
                    }, 300);
                    visibleModals.pop();
                    scope.deferred.resolve();
                };
            },

            isModalVisible : function () {
                return visibleModals.length;
            }
        };
    }]);

});

define('shared/factories/facebook',[

    // library
    'shared/base_modules/factory'

], function (

    // library
    FactoryModule

) {

    FactoryModule.factory('facebook', ['$q', 'connection', function ($q, Connection) {
        var initialized = false;
        var initDeffered = $q.defer();
        var permissions = {
            scope : 'email'
        };

        var initFb = function () {
            if (initialized) {
                return;
            }

            window.fbAsyncInit = function () {
                FB.init({
                    appId : window.config.services.facebook.id, // App ID
                    status : true, // check login status
                    cookie : true, // enable cookies to allow the server to access the session
                    oauth : true,
                    xfbml : true
                });
                FB.getLoginStatus(function (response){
                    initDeffered.resolve();
                });
            };

            // asynchronously load facebook script
            var fbRoot = document.getElementById('fb-root');
            if (fbRoot) {
                var e = document.createElement('script');
                e.type  = 'text/javascript';
                e.src = document.location.protocol +
                    '//connect.facebook.net/en_US/all.js';
                e.async = true;
                fbRoot.appendChild(e);
            }
        };

        Facebook = {
            getInitPromise : function () {
                return initDeffered.promise;
            },
            windowStatus : {
                windowOpen : false
            },
            authorize : function () {
                var deferred = $q.defer();
                var self = this;
                // NOTE: Always check if a valid FB session exists before calling .login()
                FB.getLoginStatus(function (response) {
                    if (response.status === 'connected') {
                        deferred.resolve(response);
                    } else {
                        self.connect().then(function (response) {
                            deferred.resolve(response);
                        });
                    }
                });
                return deferred.promise;
            },

            get : function (token) {
                return Connection.get({
                    url : 'https://' + window.config.fbGraphApi + '/me',
                    params : {
                        'access_token' : token
                    }
                });
            },

            connect : function () {
                var deferred = $q.defer();
                var self = this;
                self.windowStatus.windowOpen = true;
                FB.login(function (response) {
                    if (response.authResponse) {
                        deferred.resolve(response);
                    } else {
                        deferred.reject(response);
                        self.windowStatus.windowOpen = false;
                    }
                }, permissions);
                return deferred.promise;
            },

            join : function () {
                var deferred = $q.defer();
                var self = this;
                self.windowStatus.windowOpen = true;
                self.authorize().then(function (response) {
                    if (response.authResponse) {
                        FB.api('/me', { fields : 'name,email' }, function (response) {
                            if (!response.error) {
                                Connection.get({
                                    url : '/my_account/connection/facebook/search',
                                    api : false,
                                    authorize : false
                                }).then(function (resp) {
                                    if (resp.available) {
                                        deferred.resolve(response);
                                    } else {
                                        deferred.reject({tryFbLogin : true});
                                    }
                                }, function (error) {
                                    deferred.reject(error);
                                });
                            } else {
                                deferred.reject(response);
                            }
                        });
                    } else {
                        self.windowStatus.windowOpen = false;
                        deferred.reject(response);
                    }
                }, permissions);
                return deferred.promise;
            },

            login : function () {
                var deferred = $q.defer();
                this.authorize().then(function (response) {
                    if (response.authResponse) {
                        FB.api('/me', function (response) {
                            if (!response.error) {
                                deferred.resolve(response);
                            } else {
                                deferred.reject(response);
                            }
                        });
                    } else {
                        deferred.reject(response);
                    }
                }, permissions);
                return deferred.promise;
            },

            logout: function () {
                var deferred = $q.defer();

                FB.logout(function () {
                    deferred.resolve();
                });

                return deferred.promise;
            }
        };

        initFb();
        return Facebook;
    }]);
});

