define('shared/factories/player_tracking',[

    // Base factory module
    'shared/base_modules/factory',

    'lib/mixpanel'
], function (

    FactoryModule,
    Mixpanel

) {

    FactoryModule.factory('playerTracking', ['connection', 'browser_playback', function (Connection, BrowserPlayback) {

        var SAMPLING_RATE = 1;
        var rate;
        var defaultTrackingData = {};
        var playerName;
        var getPlayerName = function (playbackType) {
            if (playbackType === 'flash') {
                playerName = BrowserPlayback.supportsFlash() ? 'Player HD' : 'NoPlayback';
            } else if (playbackType === 'pjs') {
                playerName = 'Player JS';
            } else if (playbackType === 'mjs'){
                playerName = 'Player M';
            } else {
                playerName = 'NoPlayback';
            }
            return playerName;
        };

        var tracking = {
            init : function (options) {
                if (!rate) {
                    rate = Math.ceil(Math.random() * 100);
                }

                defaultTrackingData = angular.copy(options);
            },
            playerInitalized : function (options) {
                if (SAMPLING_RATE >= rate) {
                    angular.extend(options, defaultTrackingData);
                    options.player_name = getPlayerName(options.type);
                    delete options.type;
                    Mixpanel.track('Player Initialized', options);
                }
            },
            playbackStarted : function (options) {
                if (SAMPLING_RATE >= rate) {
                    angular.extend(options, defaultTrackingData);
                    options.player_name = getPlayerName(options.type);
                    delete options.type;
                    Mixpanel.track('Player Playback Started', options);
                }
            }
        }

        return tracking;
    }]);
});

