define('shared/filters/thumbnail_image_url',[

    'shared/base_modules/filter'

], function (

    FilterModule

) {

    FilterModule.filter('thumbnailImageUrl', function () {
        var sanitizeUrl = function (url, sizes) {
            // 330x180 is the dimension of the biggest event poster that we display.
            // *2 is for 2x images for retina display
            var maxWidth  = (sizes instanceof Object) ? sizes.width  : (330 * 2);
            var maxHeight = (sizes instanceof Object) ? sizes.height : (185 * 2);

            var parts = url.match(/(^https?:\/\/.*)_(\d+)x(\d+)\.(jpg|png|jpeg|gif)/);
            if (!parts || parts.length < 5) {
                return url;
            }

            var baseName = parts[1], width = parseInt(parts[2], 10),
                height = parseInt(parts[3], 10), extension = parts[4];

            if (width > height && width > maxWidth) {
                height = parseInt(height / width * maxWidth, 10);
                width = maxWidth;
            }
            if (width < height && height > maxHeight) {
                width = parseInt(width / height * maxHeight, 10);
                height = maxHeight;
            }
            return baseName + '_' + width + 'x' + height + '.' + extension;
        };

        return function (obj, sizes, defaultImage, objKeys) {
            var imageUrl;
            var keys = objKeys || ['medium_url', 'small_url', 'thumb_url', 'url'];
            var defaultPoster = '//cdn.livestream.com/website/discover/blank_event.png';

            var getImageUrl = function (imageUrl, sizes) {
                return  (imageUrl.indexOf('poster-default') > 0) ?
                    defaultPoster : sanitizeUrl(imageUrl, sizes);
            };

            if (!obj) {
                imageUrl = defaultPoster;
            } else if (typeof obj === 'string') {
                imageUrl = getImageUrl(obj);
            } else if (obj instanceof Object) {
                for (var i in keys) {
                    if ((obj[keys[i]] && obj[keys[i]] !== 'undefined')) {
                        imageUrl = getImageUrl(obj[keys[i]]);
                        break;
                    }
                }
            }
            imageUrl = imageUrl || defaultPoster;

            // Return a protocol-less URL
            return imageUrl.replace(/^https?:/, '');
        };
    });

});

