// A filter funtion to humanize number which is greater than 999
// 1000 will be returned as 1k similarly
// 120000 --> 120k
// 1200000 --> 1.2M
// 12054530 --> 12.1M

define('shared/filters/humanize_number',[

    // Base filter module
    'shared/base_modules/filter'

], function (

    FilterModule

) {

    FilterModule.filter('humanize', function () {

        var limiters = ['k', 'M', 'B'];
        var divisors = [1000, 1000000, 1000000000];

        return function (number) {
            if (number) {
                number = Math.abs(number);
                if (typeof number !== 'number' || isNaN(number) || number === 0) {
                    return '';
                }
                if (number < 1000) {
                    return number;
                }
                var numberExponentialString = number.toExponential(1);
                var numberLength = Math.abs(numberExponentialString.slice(-1));
                var index = (Math.floor(Math.abs(numberLength)/3)) - 1;
                var result = number/divisors[index];
                result = result.toFixed(1).replace('.0', ''); // .0 comes only for 1000, 10000
                return result + limiters[index];
            }
        };
    });

});

define('shared/filters/duration_format',[

    // Base filter module
    'shared/base_modules/filter'

], function (

    FilterModule

) {

    FilterModule.filter('duration', function () {
        var time = '';
        return function (millis, includeEmptyHours) {
            if (millis) {
                var millisNum = parseInt(millis, 10) / 1000;
                var hours   = Math.floor(millisNum / 3600);
                var minutes = Math.floor((millisNum - (hours * 3600)) / 60);
                var seconds = parseInt((millisNum - (hours * 3600) - (minutes * 60)), 10);
                if (hours === 0) {
                    hours = includeEmptyHours ? ("0" + hours) : "";
                } else if (hours < 10) {
                    hours = "0" + hours;
                }
                if (minutes < 10) {
                    minutes = "0" + minutes;
                }
                if (seconds < 10) {
                    seconds = "0" + seconds;
                }
                time = [hours, minutes, seconds].filter(function (i) { return i; }).join(':')       }
        };
    });

});

